(7, 3, 14, 'STOVE FMS-118', '<p style=\"text-rendering: optimizelegibility; color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\">Kompor lipat yang didesain secara sederhana, mudah digunakan dan dipelihara ini cocok digunakan saat berkemah atau mendaki ke gunung yang tinggi. Kompor ini dapat menahan angin kencang karena adanya penyekat di bagian burner. Terdapat teknologi pemanasan 2 arah yang unik untuk memastikan gas sudah cukup panas sebelum dibakar, sehingga menghemat bahan bakar. Kompor FMS118 dari Fire Maple dapat menampung berat hingga 7kg dan memiliki preheat tube untuk melancarkan penyaluran gas ke kompor agar pembakaran berfungsi normal di cuaca dingin.</p><p style=\"text-rendering: optimizelegibility; color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\"><span style=\"font-size: 1rem;\"><br></span></p><p style=\"text-rendering: optimizelegibility; color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\"><span style=\"font-size: 1rem;\">Fitur:</span></p><p style=\"text-rendering: optimizelegibility; color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\"><span style=\"font-size: 1rem;\"><br></span></p><p style=\"text-rendering: optimizelegibility; color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\"><span style=\"font-size: 1rem;\">1. Selang yang dilapisi alumunium sehingga lebih awet dan tidak mudah bocor</span></p><p style=\"text-rendering: optimizelegibility; color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\"><span style=\"font-size: 1rem;\">2.&nbsp;</span><span style=\"font-size: 1rem;\">Kepala selang yang pas saat dihubungkan dengan botol bahan bakar</span></p><p style=\"text-rendering: optimizelegibility; color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\"><span style=\"font-size: 1rem;\">3.&nbsp;</span><span style=\"font-size: 1rem;\">Keran untuk mengatur besar kecilnya api</span></p><p style=\"text-rendering: optimizelegibility; color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\"><span style=\"font-size: 1rem;\">4.&nbsp;</span><span style=\"font-size: 1rem;\">Tiga buah kaki yang kuat dan berongga sehingga lebih stabil dan tahan angin</span></p>', 140000.00, 15, '1731940581.jpg', '2024-11-18 07:36:21', '2024-11-18 07:44:52'),
(8, 4, 3, 'OUTDOOR HEADLAMP', '<div class=\"description woocommerce-product-details__short-description\" style=\"margin-bottom: 1em; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\"><div><span style=\"color: rgba(0, 0, 0, 0.8); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, 文泉驛正黑, &quot;WenQuanYi Zen Hei&quot;, &quot;Hiragino Sans GB&quot;, &quot;儷黑 Pro&quot;, &quot;LiHei Pro&quot;, &quot;Heiti TC&quot;, 微軟正黑體, &quot;Microsoft JhengHei UI&quot;, &quot;Microsoft JhengHei&quot;, sans-serif;\">Salah satu perlengkapan essensial dalam ranselmu saat bertualang luar ruang. Ukurannya ringkas dan ringan, mudah dimasukkan dalam kantung. Dilengkapi dengan 3 lampu LED terang yang bisa diatur dalam 3 mode penyinaran. Plus 3 mode kedip untuk lampu merah emergency.&nbsp; Nyaman digunakan di kepala dengan tali elastis yang adjustable sesuai lingkar kepala. Angle kemiringan lampu juga dapat diatur untuk posisi runduk. Ramah lingkungan dengan daya yang dapat diisi dengan charger HP Standard atau USB Charging.&nbsp;</span></div><div><span style=\"color: rgba(0, 0, 0, 0.8); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, 文泉驛正黑, &quot;WenQuanYi Zen Hei&quot;, &quot;Hiragino Sans GB&quot;, &quot;儷黑 Pro&quot;, &quot;LiHei Pro&quot;, &quot;Heiti TC&quot;, 微軟正黑體, &quot;Microsoft JhengHei UI&quot;, &quot;Microsoft JhengHei&quot;, sans-serif;\">&nbsp;</span></div><div><span style=\"color: rgba(0, 0, 0, 0.8); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, 文泉驛正黑, &quot;WenQuanYi Zen Hei&quot;, &quot;Hiragino Sans GB&quot;, &quot;儷黑 Pro&quot;, &quot;LiHei Pro&quot;, &quot;Heiti TC&quot;, 微軟正黑體, &quot;Microsoft JhengHei UI&quot;, &quot;Microsoft JhengHei&quot;, sans-serif;\">Aplikasi: Camping, Hiking, Outdoor, Fishing, Emergency</span></div><div><span style=\"color: rgba(0, 0, 0, 0.8); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, 文泉驛正黑, &quot;WenQuanYi Zen Hei&quot;, &quot