(9, 3, 13, 'WS CHIMBALI 2.0 FULL GLOVES', '<p><span style=\"color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\">Lindungi tanganmu dari sinar matahari ketika berkendara dengan sarung tangan wanita WS Chimbali 2.0 Full Gloves dari EIGER Riding. Kamu tidak perlu membuka sarung tangan saat ingin menggunakan ponsel dengan adanya fitur fingertips.</span></p>', 40000.00, 10, '1731940757.jpg', '2024-11-18 07:39:17', '2024-11-18 07:44:44'),
(10, 4, 4, 'DREAMCATCHER SLEEPING BAG', '<p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Sleeping bag terbaru dari Consina</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Sangat tepat digunakan saat rekreasi ataupun kegiatan outdoor/camping.</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Bahan Polyester syntetic<br>Sangat nyaman digunakan di temperatur 18 derajat ke atas<br>Mudah dilipat dan dibawa kemana-mana<br>Bahan tidak mudah tembus air<br>Dapat dijadikan tikar/ dibuka<br>Mudah dibersihkan/dilap dengan air hangat .</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Ukuran &nbsp;: 180 x 70cm<br>Ukuran terbuka : 200 x 140<br>cm<br>Ukuran packing &nbsp;: 40 x 20 cm<br>Berat : 1,2 kg</p>', 62500.00, 15, '1731940763.jpg', '2024-11-18 07:39:23', '2024-11-18 07:40:44'),
(11, 4, 6, 'FOLDING TREKKING POLE', '<p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Buat perdakianmu lebih menyenangkan dengan menggunakan Trekking Pole.</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Beberapa keuntungan menggunakan trekking pole:</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">– Membantu untuk menahan beban badan dari gravitasi.<br>– Meringankan beban lutut anda selama perjalanan.<br>– Distribusi tenaga tidak hanya pada kaki tapi juga pada lengan dan bahu<br>– Bisa dijadikan tiang kecil ketika akan mendirikan shelter darurat</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Aplikasi: Hiking, Trekking, dan orang yang butuh tumpuan saat berjalan</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Fitur dan keunggulan</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">– Posisi terpanjang 138cm<br>– Posisi terpendek 113cm<br>– Posisi terlipat 35cm terlipat 4 bagian<br>– Bagian grip 15cm bahan EVA nyaman dan empuk digenggam<br>– Berat 190gram<br>– Material alumunium pilihan, ringan dan kuat</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Dalam paket:<br>– Trekking pole<br>– Casing</p>', 70000.00, 13, '1731940963.jpg', '2024-11-18 07:42:43', '2024-11-18 07:43:04'),
(12, 3, 5, 'EXCELSIOR 75+15L 2F', '<p><span style=\"color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\">Excelsior 75+15L 2F adalah tas carrier yang dirancang untuk kegiatan ekspedisi dan trekking berdurasi panjang (lebih dari 4 hari). Tas ini dilengkapi dengan teknologi backsystem Ergo Spino Dual Frame yang dapat membagi beban secara merata dan memiliki frame berpengatur ukuran torso yang dapat menjaga tulang belakang dari resiko cedera, serta ruang sirkulasi udara yang lebih luas. Penutup carrier dapat dilepas pasang dan dijadikan sebagai tas ransel mini. Dimension: 82 x 37 x 30 cm (Vol 75L+15L) Material: Polyester 600D, Nylon Robic Hexa 100 Fitur: Kompartemen utama dengan sekat dan akses dari bagian bawah Saku sisip Saku depan Tali kompresi samping Dua saku samping berbahan mesh Dua saku atas Kompartemen untuk menyimpan water bladder Dua saku di bagian pinggang Rain cover Pengait trekking poles Kompartemen untuk menyimpan golok tebas Saku atas yang dapat di lepas pasang sesuai kebutuhan (dapat digunakan juga sebagai ransel mini) Ergospino adalah backsystem berteknologi dual frame yang dapat menjaga tulang belakang dari resiko cedera pada saat Anda beraktivitas luar ruang. Dengan posture frame yang dapat diatur untuk menyesuaikan dengan torso pemakai dan weight frame yang berfungsi untuk menyebarkan beban, teknologi ini meningkatkan kenyamanan dan stabilitas saat membawa beban. Tali dada.</span></p>', 575000.00, 10, '1731941014.jpg', '2024-11-18 07:43:34', '2024-11-18 07:43:34'),
(13, 3, 11, 'WS LORA 1.0', '<p><span style=\"color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\">Bersiaplah untuk memulai petualangan di alam bebas dengan sepatu mid-cut Lora yang dirancang khusus untuk hiking. Sepatu EIGER Mountaineering ini memiliki konstruksi mesh yang fleksibel pada lapisan luar upper sepatu dan dilengkapi aksen reflektif, sedangkan pada bagian dalamnya dilapisi dengan membran water-proof. Selain berfungsi sebagai bantalan dan peredam hentakan, Insole Ortholite® yang ringan dan berdaya evaporasi tinggi juga efektif menguapkan kelembapan untuk menjaga permukaan tetap kering. Sepatu ini juga didukung outsole Vibram ® dengan desain grip dan traksi yang adaptif untuk medan luar ruang.</span></p>', 299750.00, 10, '1731941085.jpg', '2024-11-18 07:44:45', '2024-11-18 07:44:45'),
(14, 4, 8, 'KATHMANDU 4 TENDA', '<p class=\"p1\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\"><span class=\"s1\">Outer : 210T polyester PU COATED&nbsp;</span></p><p class=\"p1\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\"><span class=\"s1\">Inner : PU coated nylon with mesh</span></p><p class=\"p2\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\"><span class=\"s2\">Floor: PU coated nylon</span></p><p class=\"p4\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Isi kemasan 48 x 15 x 13 cm:</p><p class=\"p4\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">– Frame aluminium 2 set</p><p class=\"p4\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">– Pasak 12 buah</p><p class=\"p4\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">– Tali pengikat 4 pcs</p><p class=\"p4\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">– Tenda bagian dalam</p><p class=\"p4\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">– Cover tenda</p><p class=\"p6\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\"><span class=\"s1\">Fitur:</span></p><p class=\"p6\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\"><span class=\"s1\">– Dimensi 208 x 180 x 130 cm (P x L x T)</span></p>', 400000.00, 10, '1731941139.jpg', '2024-11-18 07:45:39', '2024-11-18 07:45:39'),
(15, 3, 10, 'RECTANGULAR TARP M', '<p><span style=\"color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\">Rectangular Tarp terbuat dari material poliester, dan juga dilapisi dengan seam-sealing di area jahitan, sehingga membuat terpal ini cocok digunakan saat Anda melakukan kegiatan berkemah. Terpal multifungsi ini akan melindungi Anda dari paparan sinar matahari, hujan, selain itu Anda dapat menggunakannya sebagai hammock rainfly, atau bahkan sebagai terpal tenda. Saat sudah selesai digunakan, Anda bisa melipatnya ke ukuran yang lebih kecil ke dalam kantong yang sudah tersedia.Dimension Product: 300 x 300 cmDimension Packaging: Diameter 9 x 35 cmMaterial: 100% PolyesterFitur:Terbuat dari material poliester dan dilapisi seam-sealing tape di area jahitanDilengkapi dengan 8 titik pemasangan taliMudah dipasang dan dapat dikemas menjadi ukuran yang lebih kecil</span></p>', 110000.00, 10, '1731941147.jpg', '2024-11-18 07:45:47', '2024-11-18 07:45:47'),
(16, 3, 6, 'TRAIL ENDURO TREKKING POLE', '<p><span style=\"color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\">Menjelajah semakin aman dan nyaman denganTrail Enduro. Trekking pole dari EIGER Mountaineering ini pas digunakan dalam kondisi medan berlumpur saat sedang hiking maupun trekking. Ketika trekking, kamu bisa menyesuaikannya dengan mudah sesuai kebutuhan, mulai dari 63-135 cm, caranya dengan memutar kunciannya. Bentuknya yang dinamis pun membuat kamu tidak perlu repot untuk menyimpannya.</span></p>', 55000.00, 10, '1731941230.jpg', '2024-11-18 07:47:10', '2024-11-18 07:47:10'),
(17, 4, 9, 'MAGNUM 8 TENDA', '<p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Size:220cmx270cmx180cm + 100cm<br>Out : 190T polyester PU COATED<br>Inner : 170T polyester PA 300MM &amp; Breathable<br>Floor: PE</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">Frame : Fiber (Frame Utama 2 Set = 11 Ruas/set 53,7 Cm x 1,1 Cm)(Frame Teras 1 Set = 9 Ruas/set 53,4 Cm x 1,0 Cm)<br>Weight : 5.50 kg<br>Capacity: 7+1 persons</p>', 450000.00, 13, '1731941263.jpg', '2024-11-18 07:47:43', '2024-11-18 07:47:43'),
(18, 3, 9, 'NOVUS GUARDIAN 8P', '<p><span style=\"color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\">Setelah seharian menjelajahi alam, dapatkan istirahat yang nyaman dengan tenda Novus Guardian 8P. Luas, berdaya tahan kuat, dan memiliki ketahanan air yang baik, tenda berkapasitas delapan orang dari EIGER Mountaineering ini sangat mudah untuk dipasang. Tenda ini dirancang dengan dua akses masuk utama, dua ruang tidur, serta area vestibule yang luas untuk menyimpan barang bawaanmu dan tim. Hadir dengan tas jinjing untuk mengemas tenda membuatmu dapat membawa tenda ini dengan ringkas ke mana pun kamu bertualang.</span></p>', 1315000.00, 9, '1731941292.jpg', '2024-11-18 07:48:12', '2024-11-18 07:48:12'),
(19, 3, 8, 'PANGOLIN 4P', '<p><span style=\"color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\">Momen camping jadi nyaman maksimal bersama tenda Pangolin 4P! Tenda berkapasitas empat orang dari EIGER Mountaineering ini dirancang dengan vestibule (ruang depan) yang luas untuk menyimpan semua perlengkapanmu dan dua pintu masuk yang juga berfungsi sebagai ventilasi. Saat hujan turun, lapisan snow flap pada badan tenda ruang depan membantu mencegah air masuk agar bagian dalam tenda tetap aman dari basah. Hadir dengan carry bag membuat tenda ini mudah disimpan dan ringkas untuk kamu bawa ke mana pun destinasi berkemahmu.</span></p>', 640000.00, 10, '1731941382.jpg', '2024-11-18 07:49:42', '2024-11-18 07:49:42'),
(20, 3, 4, 'LAKE SIDE SLEEPING BAG', '<p><span style=\"color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\">Bagi Anda penggemar kegiatan outdoor, kantong tidur (sleeping bag) adalah salah satu kebutuhan utama yang tidak boleh dilewatkan. Maka dari itu, Eiger menghadirkan produk sleeping bag Lake Side untuk kenyamanan dan keamanan saat tidur di alam terbuka. Produk ini dapat menjaga tubuh tetap hangat ketika suhu menjadi dingin terutama ketika Anda sedang berada di alam terbuka, khususnya di daerah tropis dengan suhu 15</span></p>', 155000.00, 10, '1731941434.jpg', '2024-11-18 07:50:34', '2024-11-18 07:50:34'),
(21, 4, 10, 'FLY SHEET 4x3', '<p><span id=\"DWT539\" class=\"ZmSearchResult\" style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15.9992px; letter-spacing: -0.239988px;\">FLY</span><span style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15.9992px; letter-spacing: -0.239988px;\">&nbsp;SHEET&nbsp;OUTDOOR PROTECTION<br></span></p><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">Warna : GR, LBR</div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">Size : 400 x 300</div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">Jenis Bahan : 210T Ripstop 5000mm PU Waterproof</div><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif;\">&nbsp;</p><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">Berat : 0,5kg</div>', 80000.00, 11, '1731941436.jpg', '2024-11-18 07:50:36', '2024-11-18 07:50:36'),
(22, 3, 3, 'GLINT 300-HEADLAMP', '<p><span style=\"color: rgb(0, 0, 0); font-family: __Albert_Sans_0771d4, __Albert_Sans_Fallback_0771d4, albertSans-fallback;\">Langit sudah gelap, ditambah dengan cuaca hujan, dan kamu masih harus berada di luar tenda. Headlamp Glint 300 yang ringan dan ringkas ini wajib kamu bawa saat kamu hiking, trekking, dan camping. Senter kepala dari EIGER Mountaineering ini dirancang dengan IPX4 yang tetap dapat kamu gunakan di bawah hujan intensitas ringan. Selain itu, 8 mode pencahayaan dengan cahaya maksimum sebesar 300 lumens dapat menerangi jalanmu dengan jarak 15 meter. Mudah untuk digunakan kapan pun kamu perlu, senter kepala ini hadir dengan sensor gerakan yang membuatmu dapat menyalakan dan mematikan headlamp hanya dengan lambaian tangan. Fitur baterai yang dapat diisi ulang membuat senter ini sangat simpel untuk kamu gunakan kapan pun kamu siap bertualang.</span></p>', 50000.00, 8, '1731941503.jpg', '2024-11-18 07:51:43', '2024-11-18 07:51:43'),
(23, 4, 11, 'ASKOLE SEPATU', '<p><div class=\"product_meta\" style=\"box-sizing: border-box; margin: 1.2143em 0px; clear: both; font-size: 0.8571em; font-weight: 600; color: var(--porto-heading-color); font-family: &quot;Open Sans&quot;, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></div></p><div class=\"description woocommerce-product-details__short-description\" style=\"box-sizing: border-box; margin-bottom: 1em; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><p style=\"box-sizing: border-box; margin: 0px 0px 1.25rem; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\">Sepatu Hiking dan Trekking terbaru dari Consina untuk pengalaman hiking terbaik. Menggunakan bahan kulit premium yang sangat lentur dan bantalan tapak kaki yang empuk juga adanya ankle support . Askole juga menggunakan membrane premium, yang menjaga boots tetap kering, namun disaat bersamaan juga breathable dan mengeluarkan panas dari kaki.</p><p style=\"box-sizing: border-box; margin: 0px 0px 1.25rem; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\">Meski di design untuk aktifitas utama hiking, Askole juga pas untuk penggunaan harian bagi kalian yang b