(24, 4, 7, 'COOKING SET DS700', '<div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\"><div>Cooking set portable untuk group 4-5 orang. Peralatan wajib buat kalian yang hobby camping dan kegiatan luar ruang. Praktis untuk memasak dan memanaskan makanan &amp; minuman. Ringkas saat dipacking dengan kantung jaring. Bahan plastik untuk mangkung dan piring berbahan plastik food grade yang aman, membuat pengalaman campingmu jadi menyenangkan.</div><div></div><div>Aplikasi: Camping, Group Hiking, Family Camp, Travelling, Touring</div><div></div><div>Terdiri dari :</div><div></div></div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">– 1 buah panci/ pan untuk tumis/ goreng Material: Anodized Aluminum Diameter x Tinggi 22x 5CM</div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">– 2 Buah panci rebus Material: Anodized Aluminum Diameter x tinggi : 22x 13CM dan 19 x 12CM. Dilengkapi dengan tutup dan pegangan berlapis plastik tahan panas</div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">– 1 Kettle air kapasitas 1 L&nbsp;Material: Anodized Aluminum. Dengan handle pegangan berlapis plastik tahan panas.</div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">– 6 buah&nbsp;mangkuk portable berbahan plastik food grade untuk menyajikan teh atau soup dan makanan<p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\"></p><div>– 2 buah piring plastik food grade untuk penyajuan makanan ukuran Diameter x Tinggi : 18x4CM ( 1pcs) dan 16 x2cm (1pcs)</div><div><div>– 1 buah mini spatula dari kayu, dan 1 buah sendok lipat plastik</div><div>– 1 spons pembersih</div></div></div><div style=\"color: rgb(123, 133, 138); font-famil