(26, 4, 5, 'WATERPROOF BACKPACK', '<p><div class=\"product_meta\" style=\"box-sizing: border-box; margin: 1.2143em 0px; clear: both; font-size: 0.8571em; font-weight: 600; color: var(--porto-heading-color); font-family: &quot;Open Sans&quot;, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></div></p><div class=\"description woocommerce-product-details__short-description\" style=\"box-sizing: border-box; margin-bottom: 1em; color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><p style=\"box-sizing: border-box; margin: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\">Completely waterproof backpack, PVC material Kapasitas 30L</p></div>', 115000.00, 13, '1731942106.jpg', '2024-11-18 08:01:46', '2024-11-18 08:01:46'),
(27, 4, 12, 'SANCTUARY PEAK JAKET', '<div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">Pastikan pendakian dan perjalananmu nyaman dengan Jaket Consina&nbsp;<span id=\"DWT291\" class=\"ZmSearchResult\">Sanctuary Peak</span>. Dengan bahan terluar Duratex yang water resistant dan breathable, tubuhmu akan terlindung dari hujan saat di area camping dan jalur pendakian.</div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">Fitur breathablenya memungkinkan uap dari panas tubuh tersalurkan keluar jaket, sambil menahan cuaca dingin dari luar. Bahan polar di bagian dalam lembut di kulit dan memberi kehangatan. Sementara fitur thumb holes dengan bahan elastis memberikan perlindungan ekstra di telapak tangan.<p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\"></p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\">Aplikasi: &nbsp;Hiking, trekking, camping, traveling</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\">Material:<br>– Outer : Premium Duratex Polyester 100%<br>– Inner : Polar</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\">Feature:<br>–&nbsp; Hoodie / tutup kepala yang dapat dilipat plus cord lock untuk mengatur lingkar hoodie</p></div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">–&nbsp; Premium zippers dengan velcro untuk proteksi maksimal<br>– 1 kantung dada bagian luar, 1 kantung dada bagian dalam<br>– 2 kantung tangan di dua sisi jaket dengan zippers<br>– Inner polar yang hangat dan lembut</div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">– Lingkar lengan yang dapat diatur longgarnya dengan Velcro</div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">–&nbsp; Fitur thumb holes dengan bahan elastis untuk perlindungan ekstra di permukaan telapak tangan</div>', 125000.00, 9, '1731942259.jpg', '2024-11-18 08:04:19', '2024-11-18 08:04:19'),
(28, 4, 13, 'GLACIER SARUNG TANGAN', '<div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\"><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\">Sarung tangan multifungsi dari Consina untuk teman petualanganmu. Dengan bahan polyster premium bersifat waterproof dan windproof di bagian luar, dan bahan polar tebal di bagian dalam, tangan akan terlindung bahkan di cuaca ekstrim. Fitur anti slip di bagian telapak tangan, menjamin genggaman yang stabil di permukaan. Sangat berguna saat menggenggam trekking pole atau kapak es.</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\">Aplikasi: Trekking, Hiking, Outbound, Expedition</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; letter-spacing: -0.015em; font-size: 1.1428em; line-height: 1.6875;\">Fitur:<br>– Bahan Polyster premium + polar yang kuat, ringan, water resistant dan windproof.<br>– Lapisan polar pada bagian dalam, lembut dan hangat di tangan<br>– Lapisan bertekstur anti slip di bagian telapak untuk grip yang lebih kuat di permukaan.</p></div><div style=\"color: rgb(123, 133, 138); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">– Velcro yang adjustable di bagian pergelangan tangan untuk kenyamanan maksimal<br>– Isi paket: 2 pcs sarung tangan kanan dan kiri.</div>', 70000.00, 14, '1731942335.jpg', '2024-11-18 08:05:35', '2024-11-18 08:05:35'),
(29, 7, 13, 'Men’s Sierra Etip™ Gloves', '<font color=\"#2a2a2a\" face=\"helvetica-neue-lt, sans-serif\"><span style=\"font-size: 20px;\">Bahan bulu tebal yang digunakan dalam Sarung Tangan Sierra Etip™ Pria terasa lembut dan hangat di kulit Anda, bahkan saat suhu turun, sehingga Anda siap untuk pendakian tercepat atau paling santai. Pola jahitan zigzag yang unik membantu menciptakan kesesuaian yang lebih baik.</span></font>', 150000.00, 10, '1731942525.png', '2024-11-18 08:08:45', '2024-11-18 08:12:21'),
