(31, 7, 12, 'Men’s Antora Jacket', '<p>Saat cuaca berubah, kita beralih ke Antora. Dengan elemen desain praktis yang terinspirasi oleh Jaket Gunung kami yang ikonik, cangkang hujan yang sangat serbaguna ini menetapkan standar baru untuk keandalan sehari-hari. Dirancang untuk memudahkan transisi dari trotoar saat hujan ke hujan lebat di jalan raya, trotoar ini dibuat menggunakan kain DRYVENT™ tahan air dan tahan angin daur ulang kami. Ini adalah cakupan terbaik dari kota ke jalan setapak, dengan fokus pada detail yang paling penting saat awan mulai mendung. Kenakan sepanjang hari atau kemas untuk berjaga-jaga—Anora selalu siap.</p>', 412000.00, 9, '1731942702.png', '2024-11-18 08:11:42', '2024-11-18 08:11:42'),
(32, 5, 8, 'Lorentz Ultralight', '<p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Fitur :</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Flysheet : 20D Nylon Ripstop PU 3300MM, UPF 50+, Seam taped</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Specification Product :</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Poles: Alumunium Poles 8.5mm with Triangle Joining</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Peg : Alumunium Y Stakes</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Guyrope : Reflecting Guyrope D3mm with Triangle Stopper</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Produk ini Didesain Khusus Untuk Areingers Dengan Kualitas Terbaik,</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Brand Arei berawal dari sebuah pemikiran, ide dan mimpi serta keyakinan memberikan yang terbaik untuk alam dan negeri. Arei pun lahir menjadi sebuah kekuatan baru dalam industri tas khususnya tas untuk para penggiat alam. Di tahun 2005, Arei menginginkan sebuah produk yang sangat menunjang berbagai kegiatan para penggiat alam maupun yang berkegiatan di alam luar.</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\"><br></p>', 150000.00, 9, '1731942785.jpeg', '2024-11-18 08:13:05', '2024-11-18 08:13:05'),
(33, 7, 11, 'Men’s Offtrail TR GORE-TEX® Shoes', '<p>Offtrail Pria TR GORE-TEX® adalah sepatu siap berpetualang yang dibuat untuk unggul dalam lingkungan teknis off-trail, sehingga Anda dapat melangkah lebih jauh dan lebih cepat. Sepatu ini memiliki membran tahan air, penutup jari kaki, midsole dengan rebound tinggi untuk bantalan di jalan, dan outsole karet SURFACE CTRL™ dengan lug 5 mm untuk cengkeraman luar biasa di berbagai medan. Alas kaki tahan air kami menggabungkan berbagai bahan, perawatan, dan proses anti air yang canggih. Untuk membantu menjaga kaki tetap kering, kami menggunakan membran kedap air internal dan/atau konstruksi perekat dan segel jahitan.</p>', 680000.00, 10, '1731942836.png', '2024-11-18 08:13:56', '2024-11-18 08:13:56'),
