'1731942931.jpg', '2024-11-18 08:15:31', '2024-11-18 08:15:31'),
(35, 7, 8, 'Wawona 4 Tent', '<p>Tenda Wawona yang dapat menampung empat orang, dinamai sesuai nama Sequoia yang ikonik, telah diberi penyegaran. Kami telah beralih dari konstruksi berdinding tunggal menjadi berdinding ganda, merekayasa ulang tiang-tiangnya, dan mempermudah pemasangannya. Jangan khawatir— kami menjaga ruang depan yang besar sehingga tidak terasa seperti tenda, melainkan seperti rumah.</p>', 1500000.00, 8, '1731942935.png', '2024-11-18 08:15:35', '2024-11-18 08:15:35'),
