(37, 7, 4, 'Blue Kazoo Sleeping Bag', '<p>Blue Kazoo adalah kantong tidur anti air 20 derajat yang dibuat dengan insulasi 700 isi daur ulang. Tas ringan dan dapat dikompres ini memberikan kehangatan, kenyamanan, dan kinerja luar biasa.</p>', 1000000.00, 10, '1731943037.png', '2024-11-18 08:17:17', '2024-11-18 08:17:17'),
(38, 5, 6, 'Hightrack 02', '<p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">SPESIFIKASI</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Bahan : Duralium (Alumunium)</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Ukuran : Panjang Minimal :53 CM</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Ukuran : Panjang Maximal : 110 CM (4 Step)</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Berat : 365gr</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Fitur :</p><ul style=\"list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\"><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\">Senter 9 LED + baterai</li><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\">Dilengkapi Antishock</li><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\">Snow Mud Basket mencegah Tip Trakking Pole menancap terlalu dalam ke tanah, pasir, lumpur atau salju</li></ul>', 35000.00, 13, '1731943120.jpeg', '2024-11-18 08:18:40', '2024-11-18 08:18:40'),
(39, 5, 10, 'Fly Sheet Cover', '<p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Fly Sheet Cover Tenda 150 x 250 V2 Arei Outdoorgear Terbuat dari bahan anti air yang berfungsi sebagai pelindung tenda dari hujan maupun terik matahari langsung. Selain itu Flysheet juga berfungsi sebagai pengganti tenda dalam keadaan darurat.</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Spesifikasi :</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Bahan : Taslan</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Ukuran : 150 cm X 250 cm</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Fitur :</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">-Bahan Waterproof</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">-Cocok untuk Shelter/Bivak</p>', 33500.00, 7, '1731943245.jpeg', '2024-11-18 08:20:45', '2024-11-18 08:20:45'),
(40, 5, 11, 'Blacksmith Arei', '<p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\"><span style=\"font-weight: bolder;\">Fitur</span></p><ul style=\"list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\"><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\">Model Mid cut</li></ul><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Memberikan proteksi lebih saat beraktifitas</p><ul style=\"list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\"><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\">Semi waterproof upper</li></ul><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Bahan suede semi waterproof melindungi kaki Areingers dari air intensitas ringan</p><ul style=\"list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\"><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\">Rubber toe bumber</li></ul><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Pelindung ujung kaki Areingers saat aktifitas pendakian</p><ul style=\"list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\"><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\">&nbsp;Multi Directional Traction sole</li></ul><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Sistem sol karet anti slip</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\"><span style=\"font-weight: bolder;\">Spesifikasi</span></p><ul style=\"list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\"><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\">Bahan upper : suede leather and polyester mesh membrane</li><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\">Mid sole : EVA</li><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\">Outsole : Rubber</li></ul>', 135000.00, 11, '1731943322.jpg', '2024-11-18 08:22:02', '2024-11-18 08:22:02'),
(41, 5, 5, 'Geiser Adv 60 Liter', '<p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Spesifikasi :</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Bahan : Nylon + Polyester</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Ukuran : 58 x 30 x 20 cm</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Berat : 1.900gr</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Fitur :</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Materi utama Nylon Kombinasi Polyester dan Cordura</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Backsystem Ergo-fit menggunakkan Double Frame dengan bahan Alumunium Alloy yang kuat dan ringan</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Bagian punggung yang dapat diatur sesuai ukuran Torso pengguna mulai dari size M-XL</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Dilengkapi bantalan yang tebal, empuk, halus</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Nyaman di bagian sandang, punggung dan hip belt</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Penutup carrier dapat dilepas pasang dan dijadikan sebagai tas pinggang</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– 1 Saku depan</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– 2 Saku samping</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– 2 Saku tutup atas</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– 2 Saku Hip Belt</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Bagian Hip Belt dapat di adjust (menyesuikan)</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Tali kompresi di bagian samping</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Tali tambahan di bagian bawah carrier untuk menyimpan matras, sleeping bag atau keperluan lainnya</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Terdapat lubang Water Bladder</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Peluit</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Rain cover</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Air Flow System</p>', 199000.00, 14, '1731943421.jpeg', '2024-11-18 08:23:41', '2024-11-18 08:23:41'),
(42, 5, 12, 'Authentic Daytona', '<p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Spesifikasi :</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Bahan : Polyester (Waterproof)</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Penutup kepala</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– 2saku bagian luar</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– 2saku bagian dalam</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Tali stopper bagian bawah jaket</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Ventilasi udara bagian belakang</p>', 130000.00, 8, '1731943505.jpeg', '2024-11-18 08:25:05', '2024-11-18 08:25:05'),
(43, 5, 13, 'Cold Runner', '<p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Fitur</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Model Full Jari</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Velcro Pada Bagian Pergelangan Tangan</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Tekstur Kain Halus dan Lembut di Telapak Tangan</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">– Touch Screen dijari telunjuk dan ibu jari</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Warna dan Size</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Hitam</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">M-XL</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Sarung Tangan Cold Runner Full Glove Arei Outdoorgear merupakan Sarung tangan yang terbuat dari bahan Poliester yang nyaman digunakan saat berkendara. Sarung Tangan Cold Runner Full Glove siap menemani petualangan Areingers.</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">&nbsp;</p><p style=\"margin-bottom: 1.3em; color: rgb(48, 48, 48); font-family: &quot;DM Sans&quot;; font-size: 14.4px;\">Brand Arei berawal dari sebuah pemikiran, ide dan mimpi serta keyakinan memberikan yang terbaik untuk alam dan negeri. Arei pun lahir menjadi sebuah kekuatan baru dalam industri tas khususnya tas untuk para penggiat alam. Di tahun 2005, Arei menginginkan sebuah produk yang sangat menunjang ber